CREATE DEFINER=`root`@`localhost` PROCEDURE `GetLeastBorrowedBooks`()
BEGIN
    SELECT b.book_id, b.book_title, COUNT(bl.book_id) AS borrow_count
    FROM book_loan bl
    JOIN book b ON bl.book_id = b.book_id
    GROUP BY b.book_id, b.book_title
    ORDER BY borrow_count
    LIMIT 10;
END ;;
