CREATE DEFINER=`root`@`localhost` PROCEDURE `GetOverdueBooks`()
BEGIN
    SELECT bl.book_loan_id, bl.book_id, b.book_title, bl.student_id, bl.expected_return_date, bl.actual_return_date
    FROM book_loan bl
    JOIN book b ON bl.book_id = b.book_id
    WHERE bl.actual_return_date > bl.expected_return_date OR (bl.expected_return_date < CURDATE() AND bl.actual_return_date IS NULL);
END ;;
