CREATE DEFINER=`root`@`localhost` PROCEDURE `GetOverdueStudentsByCourseAndClass`(
    IN course_param YEAR, 
    IN class_param VARCHAR(10)
)
BEGIN
    -- Kim tra v gn gi tr mc nh nu tham s l chui rng
    SET @course = IF(course_param IS NULL, NULL, course_param);
    SET @class = IF(class_param = '', NULL, class_param);

    SELECT s.student_id, CONCAT(s.first_name, ' ', s.last_name) AS student_name, s.course, s.class, bl.book_loan_id, bl.book_id, b.book_title, bl.expected_return_date, bl.actual_return_date
    FROM book_loan bl
    JOIN student s ON bl.student_id = s.student_id
    JOIN book b ON bl.book_id = b.book_id
    WHERE (bl.actual_return_date > bl.expected_return_date OR (bl.expected_return_date < CURDATE() AND bl.actual_return_date IS NULL))
    AND (s.course = @course OR @course IS NULL)
    AND (s.class = @class OR @class IS NULL);
END ;;
